import React, { Component } from 'react';

import './styles/travelCountryLess.less';

class TravelCountryEl extends Component {

  createImageEls() {
    const imgEls = [];
    Object.keys(this.props.countryData).forEach((city) => {
      currentCountry[city].forEach((img) => {
        imgEls.push(
          <img
            key={img}
            className="travel-modal-img"
            src={process.env.PUBLIC_URL + `/img/${this.state.showCountry}/${city}/${img}`}
            alt="logo" />
        );
      });
    });
    return imgEls;
  }

  render() {
    const countryModal = this.state.showModal ? this.createModal() : "";
    return (
      <div className="travel">
        <div className="travel-description">love the world around you!</div>
        <div className="travel-map"></div>
        {countryModal}
      </div>
    );
  }
}

export default Travel;
